webpackJsonp([0xe8e80c456fba],{486:function(n,s){n.exports={data:{site:{siteMetadata:{title:"Kamarul Risman",author:"Kamarul Risman"}},markdownRemark:{id:"/home/risman/Belajar baru/Blog/gatsby-blog/src/pages/Asynchronous-Synchronous/index.md absPath of file >>> MarkdownRemark",html:'<p>Disini saya akan membahas pengertian dari <strong>Asynchronous dan Synchronous</strong> dalam Javascript</p>\n<blockquote>\n<p><strong>Asynchronous</strong> merupakan suatu proses dalam Javascript yang tidak menunggu perintah lainnya\nuntuk di eksekusi. <strong>Asynchronous</strong> menjalankan proses berdasarkan waktu, perintah yang lebih\ncepat diproses akan di eksekusi lebih dahulu dan tidak menunggu perintah lainnya yang sedang dalam\nproses untuk di eksekusi.</p>\n</blockquote>\n<p>Contoh <strong>Asynchronous</strong> :</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text1\'</span><span class="token punctuation">)</span>\n<span class="token function">setTimeout</span><span class="token punctuation">(</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text2\'</span><span class="token punctuation">)</span>\n<span class="token punctuation">}</span><span class="token punctuation">,</span> <span class="token number">7000</span><span class="token punctuation">)</span> <span class="token comment">// tunda selama 7 detik</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text3\'</span><span class="token punctuation">)</span>\n<span class="token function">setTimeout</span><span class="token punctuation">(</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text4\'</span><span class="token punctuation">)</span>\n<span class="token punctuation">}</span><span class="token punctuation">,</span> <span class="token number">4000</span><span class="token punctuation">)</span> <span class="token comment">// tunda selama 4 detik</span>\n\n<span class="token comment">/*-----\nhasilnya :\nText1\nText3\nText4\nText2\n------*/</span>\n</code></pre>\n      </div>\n<p>Proses <strong>Asynchronous</strong> tidak menunggu proses Text2 dan Text4 yang ditunda menggunakan <em>setTimeout()</em> , proses yang lebih cepat akan di eksekusi lebih dahulu.</p>\n<blockquote>\n<p><strong>Synchronous</strong> adalah suatu proses dalam Javascript yang mengeksekusi kode atau perintah dari\natas ke bawah secara berurutan. Isyarat untuk melakukan proses eksekusi berikutnya adalah proses\neksekusi sebelumnya.</p>\n</blockquote>\n<p>Contoh <strong>Synchronous</strong> :</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text1\'</span><span class="token punctuation">)</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text2\'</span><span class="token punctuation">)</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">\'Text3\'</span><span class="token punctuation">)</span>\n\n<span class="token comment">/*-----\nhasilnya :\nText1\nText2\nText3\n------*/</span>\n</code></pre>\n      </div>\n<p><strong>Synchronous</strong> melakukan proses eksekusi Text1, Text2 dan Text3 secara berurutan sesuai dengan urutan kode.</p>',frontmatter:{title:"Asynchronous dan Synchronous",date:"December 12, 2017"}}},pathContext:{slug:"/Asynchronous-Synchronous/",previous:{fields:{slug:"/hi-folks/"},frontmatter:{title:"New Beginnings"}},next:{fields:{slug:"/var-let-const/"},frontmatter:{title:"var, let dan const"}}}}}});
